import React from 'react'
import { MDBCol, MDBContainer, MDBFormInline, MDBIcon, MDBRow } from "mdbreact";

function Searchbar() {
    return (
        <MDBContainer>
            <MDBRow>
                <MDBCol sm="11"><input className="form-control form-control w-100 mb-5" type="text" placeholder="Search" aria-label="Search" /></MDBCol>
            </MDBRow>
        </MDBContainer>
    )
}

export default Searchbar
